import react, { useEffect } from 'react';
import Navbar from "./layout/Navbar";
import Home  from "./pages/Home";

//Redux
import { useDispatch } from 'react-redux';

// Router
import { Switch, Route } from 'react-router-dom';
//Pages
import Login from "./pages/auth/Login";
import Register from "./pages/auth/Register";

//Admin
import HomeAdmin  from "./pages/admin/HomeAdmin";
//User
import HomeUser from "./pages/user/HomeUser";

//function
import { currentUser } from './functions/auth';

function App() {
  const dispaich = useDispatch();

  //const idTokenResult = localStorage.token;
  //console.log('APP.js', idTokenResult)

  useEffect(() => {
    const idTokenResult = localStorage.token;
    if (idTokenResult){
      currentUser(idTokenResult)
        .then(res => {
          console.log(res.data)
        }).catch(err => {
          console.log(err)
        })
    }

  })


  return (
    <>
      <Navbar />
      <Switch>
        <Route exact path="/" component={Home} />
        <Route exact path="/login" component={Login} />
        <Route exact path="/Register" component={Register} />

        <Route exact path="/home-admin" component={HomeAdmin} />
        <Route exact path="/home-user" component={HomeUser} />
      </Switch>
    </>
  );
}

export default App;
